import React, { Component } from "react";
// import Picker, { SKIN_TONE_MEDIUM_DARK } from "emoji-picker-react";
import "./Emoji.css";
export default class Emoji extends Component {
  emojisList = [
    "🔥",
    "💥",
    "😃",
    "🏵️",
    "💕",
    "❤️",
