    "💯",
    "💥",
    "✈️",
    "💲",
    "🤑",
    "💱",
    "📈",
    "💵"
  ];
  onDoubleClick = emojiObject => {
    this.props.onSelectionDone(emojiObject);
  };

  renderEmojiIcon = (icon, index) => {
    return (
      <div class="col emoji-div" onDoubleClick={() => this.onDoubleClick(icon)}>
        {icon}
      </div>
    );
  };

  render() {
    return (
      <div>
        <div class="row emoji-main-div">{this.emojisList.map(this.renderEmojiIcon)}</div>
        {/* <Picker onEmojiClick={this.onDoubleClick} skinTone={SKIN_TONE_MEDIUM_DARK} /> */}
      </div>
    );
  }
}
